        <CardBook post={item}/>
      )}
      dataSource={[
          {
            title: 'title',
            image: '//aa',
            type: 'image',
            user: {
                username: 'username',
                avatar: '//aa'
            },
            count: {
                likes: 1
            }
        },
        {
          title: 'title',
          image: '//aa',
          type: 'image',
          user: {
              username: 'username',
              avatar: '//aa'
          },
          count: {
              likes: 1
          }
        }
      ]}
    />
  </div>
)

export default App
